import axios from "axios";
import { useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";

const URI = "http://localhost:8000/recipes/";
const URI2 = "http://localhost:8000/categories/";

const CompEditRecipes = () => {
    
        const {id} = useParams();
        const [nombre, setNombre] = useState('');
        const [descripcion, setDescripcion] = useState('');
        const [tiempo, setTiempo] = useState('');
        const [instrucciones, setInstrucciones] = useState('');
        const [informacion, setInformacion] = useState('');
        const [categorias, setCategoria] = useState([]);
        const [selectedCategoria, setSelectedCategoria] = useState('');
        const [mostrarSelect, setMostrarSelect] = useState(true);
        const [categoriaInput, setCategoriaInput] = useState('');
        const [descripcionCategoria, setDescripcionCategoria] = useState('');
        const navigate = useNavigate();
    
        useEffect( ()=>{
            getCategories()
        },[])
    
        //Obtener Categorias
        const getCategories = async () => {
            const res = await axios.get(URI2);
            setCategoria(res.data);
        }
    
        //Procedimiento para actualizar receta
    
        const update = async (e) => {
            e.preventDefault();
    
            const recipe = {
                nombre_receta: nombre,
                descripcion_receta: descripcion,
                tiempo_preparacion: tiempo,
                intrucciones: instrucciones,
                informacion_nutricional: informacion,
                id_categoria: selectedCategoria 
            }
    
            if(!mostrarSelect){
                const categoria = {
                    nombre_categoria: categoriaInput,
                    descripcion_categoria: descripcionCategoria
                }
                const res = await axios.post(URI2, categoria);
                if(res.data.success){
                    recipe.id_categoria = res.data.id;
                    await axios.put(URI+id, recipe);
                    navigate('/recipes');
                }
            }else{
                await axios.put(URI+id, recipe);
                navigate('/recipes');
            }
        }
    
        useEffect( ()=>{
            const getRecipeById = async () => {
                const res = await axios.get(URI+id);
                setNombre(res.data.nombre_receta);
                setDescripcion(res.data.descripcion_receta);
                setTiempo(res.data.tiempo_preparacion);
                setInstrucciones(res.data.intrucciones);
                setInformacion(res.data.informacion_nutricional);
                setSelectedCategoria(res.data.id_categoria);
                console.log(res.data.id_categoria);
            }
            getRecipeById();
        },[id])
    
        return (
            <div>
                <h3>Editar Receta</h3>
                <form onSubmit={update}>
                    <div className="mb-3">
                        <label>Nombre</label>
                        <input type="text" className="form-control" onChange={(e)=>setNombre(e.target.value)} value={nombre}/>
                    </div>
                    <div className="mb-3">
                        <label>Descripcion</label>
                        <input type="text" className="form-control" onChange={(e)=>setDescripcion(e.target.value)} value={descripcion}/>
                    </div>
                    <div className="mb-3">
                        <label>Tiempo de preparacion</label>
                        <input type="text" className="form-control" onChange={(e)=>setTiempo(e.target.value)} value={tiempo}/>
                    </div>
                    <div className="mb-3">
                        <label>Instrucciones</label>
                        <input type="text" className="form-control" onChange={(e)=>setInstrucciones(e.target.value)} value={instrucciones}/>
                    </div>
                    <div className="mb-3">
                        <label>Informacion nutricional</label>
                        <input type="text" className="form-control" onChange={(e)=>setInformacion(e.target.value)} value={informacion}/>
                    </div>
                    <div className="mb-3">
                        <label>Categoria</label>
                        <select className="form-control" onChange={(e)=>setSelectedCategoria(e.target.value)}>
                            <option value="">Seleccione una categoria</option>
                            {categorias.map(categoria => (
                                <option value={categoria.id}>{categoria.nombre_categoria}</option>
                            ))}
                        </select>
                    </div>
                    <button type="submit" className="btn btn-primary">Actualizar</button>
                </form>
            </div>
        )

}

export default CompEditRecipes;
